import React, { Component } from 'react';
import { Space, Divider, Typography } from 'antd';
import TopNavBar from "./components/TopNavBar"
import ProjectSummary from "./components/ProjectSummary"
import ArticleSummary from "./components/ArticleSummary"
import ContactMe from "./components/ContactMe"
import BlogMain from "./components/BlogMain"
import EntryMain from "./components/EntryMain"
import './App.css';
import { EntryMeta } from './data/Entry'

import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";
import TerminalDisplay, { TerminalCarousel } from './components/Terminal';
const { Title } = Typography



const articleEntries = [
  //{EntryMeta(title="hello", published="1/1/1", summary="this is my summary", resource="www.")}
  { title: "hello1", published: "True", code: "pythonxy", summary: "this is my summary", timestamp: "2020-05-06", resource: "www.test", slug: "slug1" } as EntryMeta,
  { title: "hello2", published: "True", code: "pythonxy", summary: "this is my summary", timestamp: "2020-05-06", resource: "www.test", slug: "slug1" } as EntryMeta,
  { title: "hello1", published: "True", code: "pythonxy", summary: "this is my summary", timestamp: "2020-05-06", resource: "www.test", slug: "slug1" } as EntryMeta,
  { title: "hello2", published: "True", code: "pythonxy", summary: "this is my summary", timestamp: "2020-05-06", resource: "www.test", slug: "slug1" } as EntryMeta,
]

const projectEntries = [
  { title: "hello1", published: "True", code: "pythonxy", summary: "this is my summary", timestamp: "2020-05-06", resource: "www.test", slug: "slug1" } as EntryMeta,
  { title: "hello2", published: "True", code: "pythonxy", summary: "this is my summary", timestamp: "2020-05-06", resource: "www.test", slug: "slug1" } as EntryMeta,
  //{title:"hello2", published:"True", summary:"this is my summary", timestamp:"2020-05-06", resource:"www.test", slug:"slug2"} as EntryMeta,
  //{title:"hello3", published:"True", summary:"this is my summary", timestamp:"2020-05-06", resource:"www.test", slug:"slug3"} as EntryMeta,
]

class App extends Component {
  render() {
    return (
      <div className="App">
        <Router>
          <TopNavBar />
          <div className="main">
            <Switch>
              <Route exact path={["/", "/home"]}>
                <Space direction="vertical" style={{width:"80%"}}>
                  <div className="parallax">
                    <div className="fade-in-title">Brendan Copp</div>
                  </div>
                  <div style={{marginTop:"15px", marginBottom:"0px"}}><h1>Recent Projects</h1></div>
                  <Divider/>
                  <TerminalCarousel entries={projectEntries} />
                  <Divider/>
                  <h1>My Life Up Until Now</h1>
                  <Divider/>
                  <ArticleSummary entries={articleEntries} />
                  <Divider/>
                  <ContactMe />
                </Space>
                {/*<div className="filler"></div>*/}
              </Route>
              <Route exact path="/blog" component={BlogMain} />
              <Route path="/:slug" component={EntryMain} />
            </Switch>
          </div>
        </Router>
      </div>
    );
  }
}
//<ProjectSummary entries={projectEntries}/>

{/*<Button type="primary">Button</Button>*/ }
export default App;
